import React, { Component } from 'react'
import './Header.css'
import {Link} from 'react-router-dom';
class Header extends Component {

     constructor(props) {
         super(props)

         this.state = {
              loginStatus:JSON.parse(localStorage.getItem("loginStatus"))
         }
     }


    render() {
        return (
            <div>
              <div className="topnav">

                <div className="link" > <Link to ="/" >Home</Link></div>

                @if(this.state.loginStatus==false)
                {
                <div className="link" > <Link to ="/Login" >Login</Link></div>
                }
                <div className="link" > <Link to="/AboutUS">About Us</Link></div>
                <div className="link" > <Link to="/Cart">cart 0</Link></div>
                <div className="Search-Bar">
                   <input className="search-content" type ="text" placeholder="Search book" name="search bar"></input>
                   <button className="search-submit-button" type="submit" value="Submit" >Search</button>
                </div>

                </div>
            </div>    
        )
    }
}

export default Header;
